import React, { useState } from "react";

function TextForm(props) {
    const [text, settext] = useState('Enter Your Name');
    return (
        <div>
            <h1>{props.heading} - {text}</h1>
            <div>
            <input type="text" placeholder="Enter Your Text" />
            </div>
        </div>
    )
}
export default TextForm;
